from sklearn.metrics import confusion_matrix
import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sn
import os

def confusion(y_true, y_predict, arch, pca = True, plot = False):
    #make confusion matrix
    cm = confusion_matrix(y_true, y_predict, labels = ["famous", "scrambled", "unfamiliar"], normalize='true')
    df_cm = pd.DataFrame(cm, index = ["true label: famous", "true label: scrambled", "true label: nonfamous"],
                        columns = ["predicted: famous", "predicted: scrambled", "predicted: nonfamous"])

    plt.figure(figsize = (10,7))
    plt.title(f"Confusion matrix for k = {arch}")
    sn.heatmap(df_cm, annot=True)
    if plot:
        plt.show()
    
    path = "Classifier/confusion_plots"
    # make save diractory
    if pca:
        path += "/pca"
    else:
        path += "/no_pca"
    if not os.path.exists(path):
        os.makedirs(path)
        
    plt.savefig(path + f"/k_{arch}_normalized")
    

